import { Flex, Card, Grid, Text, Heading, Paragraph } from '@contentful/f36-components';
import tokens from '@contentful/f36-tokens';
import { css } from 'emotion';
import React from 'react';
import VariationItem from './VariationItem';

const styles = {
   heading: css({
      marginBottom: '0px'
   }),
   container: css({
    backgroundColor: 'yellow'
   })
}

function Variations(props) {
  const variations = [1,2,3,4]
  return (
    <React.Fragment>
      <Heading element='h2' className={styles.heading}>Variations:</Heading>
      <Flex alignItems='center' flexDirection='column' justifyContent='center' className={styles.container}>
         <Card padding="spacingL" radius="medium">
            <Grid rowGap="spacingM" columns='1fr 1fr' columnGap='spacingM'>
            <Text as="h4" fontWeight="fontWeightBold">Feature Name:</Text>

               {variations.map(variation => {
                <Grid.Item>
                    <Text as="h4" fontWeight="fontWeightBold">Feature Name:</Text>
                </Grid.Item>
               })}
            </Grid>
         </Card>
      </Flex>
    </React.Fragment>
  )
}

export default Variations;
